(1, '2014-02-13', 'Liebe(r) {name},\r\n\r\ndies ist eine automatisch durch flybook und ameAVIA erzeugte Abrechnung. Nach Berechnung und Buchung der Fluggebühren des letzten Monats in Höhe von {summe} EUR beträgt Dein Saldo auf dem Fluggeldkonto nun\r\n\r\n{saldo} EUR.\r\n\r\nBitte prüfe Deine Flüge und Deinen Kontostand und teile etwaige Unstimmigkeiten dem Vorstand mit.\r\n\r\nBitte berücksichtige, dass möglicherweise letzte Zahlungseingänge noch nicht verbucht und damit in der Abrechnung unberücksichtigt sind.\r\n\r\nSofern Dein Konto einen negativen Stand aufweist und Du keine Abbuchungserlaubnis erteilt hast, gleiche bitte Dein Konto in den nächsten Tagen selbst aus.\r\n\r\nFliegerische Grüße\r\n\r\nVorstand Aero Club Butzbach e.V.');
